import React from 'react';

function Sidebar() {
    return (
    <aside>
        <h2>Other Articles</h2>
        <ul>
            <li><button>Article One</button></li>
            <li><button>Article Two</button></li>
            <li><button>Article Three</button></li>
		</ul>
      </aside>
    )
}

export default Sidebar;
